import React from 'react';
import Header from '../header/Header';
import Main from '../body/Main';
import Nav from '../nav/Nav';
import Footer from '../footer/Footer';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
